import React from 'react'
import { Link } from 'react-router-dom';



export class Login extends Component {
  render(){
    return (
    <div className="details" style={{height:'500px',width:'500px'}}>
        <h2>Login</h2>
        <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">Email address</label>
            <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com"></input>

            <label for="exampleFormControlInput1" class="form-label">Password</label>
            <input type="password" class="form-control" id="exampleFormControlInput1" placeholder="5342122"></input>
            <button>Login</button>
            <p>Don't have an account<Link className="nav-link"  to="/signup" >Register Here</Link></p>

        </div>
    </div>
  )
}
}

export default Login
